import React from "react";

function Skills() {
  return (
    <div className="breathe">
      <h2 id="skills" style={{ marginBottom: "-10px" }}>
        Tech Chops
      </h2>
      <div className="flexContainer">
        <div className="skillsBox">
          <h4>Front End</h4>
          <p>HTML5</p>
          <p>CSS3</p>
          <p>React.js</p>
        </div>
        <div>
          <h4>Back End</h4>
          <p>Express</p>
          <p>Knex</p>
          <p>SQL</p>
          <p>PostgreSQL</p>
        </div>
        <div>
          <h4>Other Stuff</h4>
          <p>Mocha - Chai - Git - GitHub - Node.js</p>
        </div>
      </div>
    </div>
  );
}

export default Skills;

